import React from 'react';
import Header from './Header';
import '../css/EventPage.css';
import Calendar from '../img/달력.png';

function EventPage() {
  return (
    <div>
      <Header />
      <div id='container'>
        <h1>이벤트페이지입니다.</h1>

        <form id='SearchForm'>
          <span id='SearchResult'>검색 결과 </span>
          <div>
            <input type='text' />
            <span id='InputBar'>|</span>
            <img src={Calendar} alt='Calendar' />
            <input id='Calendar' type='text' />

            <span id='InputBar'>|</span>
            <input type='text' />
            <button id='SearchButton' type='submit' className='btn btn-primary'>
              검색하기
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default EventPage;
